import Footer from './components/footer'

function App() {
  return (
    <Router>
      <Root>
        <Header></Header>
        <Main>
          <Hero></Hero>
          <LoginModule></LoginModule>
        </Main>

        <Footer></Footer>
      </Root>
    </Router>
  );
}

export default App;
